import React, { Component } from "react";

class About extends Component {
  render() {
    return (
        <div>
            The Tembo Group is a social impact advisory firm.

            We provide strategic support to philanthropists, companies and non-profits with the resources, scale or ideas to solve the world's most pressing challenges.

            We brign together the strongest minds and managers with the deepest rolodexes, and constellate teams with the experience and whereithal to get any job done.

            We lead good intentions to great ideas - moving them from concept through to execution, launch and impact.

            We are motivated solely by our desire to safeguard our planet, and build safe, healthy, equitable societies.
        </div>
    );
  }
}

export default About;
